import React, { Component } from 'react'

class Navbar extends Component {
    render() {
        return (
            <div>
                <nav class="navbar navbar-dark bg-dark">
                <h2>Egba Sistem</h2>
                </nav>
            </div>
        )
    }
}
export default Navbar;
